siteStyleNameMint:"Fresh",websiteStyleNameModern:"Modern",websiteStyleNameNatural:"Natural",websiteStyleNameNordic:"Nordic",websiteStyleNameOcean:"Ocean",websiteStyleNamePastel:"Pastel",websiteStyleNamePlayful:"Playful",websiteStyleNameTropical:"Tropical",websiteTermsOfUseBodyText:"# Terms and Conditions\n\nSelling and entering into contracts online have become indispensable channels when it comes to having a business. The first rule of thumb in operating your business online is ensuring that your customers know what to expect and how to expect it.  Although there’s no actual legal requirement for having terms and conditions for your website in some countries, they’re definitely still worth considering in order to afford your online business legal protection. Not to mention the fact that with appropriate terms, you can ensure that your customers are adequately informed when it comes to buying goods or services from you. \n\n<p><br></p>\n\nOf course terms of use will vary depending on the type of business you operate, the nature of your business offer and the legal requirements in your chosen market. You don’t take chances when it comes to creating your website, so don’t take chances when it comes to important texts for your online business. As with any agreement you enter into, it’s definitely a good idea to consult with a legal expert before posting binding terms of use on your website. To get you started we suggest you consult some of the well known terms of use generators that you’ll find with a quick search. Make sure to find one that’s suitable to your market and remember that terms of use generators cannot replace the expertise of a legal expert.",wizardAlreadyHaveAnAccount:"Already signed up? Log in here.",wizardAlreadySignedUp:"Already have an account?",wizardBackButtonLabel:"Back",wizardBusinessCategoryStepAdditionalInformation:"We use this information to recommend the right tools and services for your business.",wizardBusinessCategoryStepSearchInputPlaceho