websiteStoreFormLabelZipCode:"CAP",websiteStoreFrontPageTitle:"Negozio",websiteStoreIbanHeadline:"Completa l'ordine e pagare",websiteStoreIbanLabel:"IBAN",websiteStoreIbanTerms:"Indicando il tuo IBAN e confermando il pagamento, autorizzi noi e Stripe, il nostro fornitore di servizi di pagamento, a richiedere alla banca del debitore l’addebito del suo conto e l’autorizzazione alla banca del debitore di procedere a tale addebito conformemente alle disposizioni impartite da Stripe. Il debitore ha diritto di ottenere il rimborso dalla propria Banca secondo gli accordi ed alle condizioni che regolano il rapporto con quest’ultima. Se del caso, il rimborso deve essere richiesto nel termine di 8 settimane a decorrere dalla data di addebito in conto.",websiteStoreIbanTermsWithBusinessName:"Fornendo le tue informazioni di pagamento e confermando quest'ultimo, autorizzi (A) {businessName} e Stripe, il nostro provider di pagamento, a inviare istruzioni alla tua banca finalizzate all'addebito sul tuo conto e (B) la tua banca a effettuare l'addebito sul tuo conto in virtù di tali istruzioni. Tra gli altri, avrai il diritto a un rimborso da parte della tua banca secondo i termini e le condizioni del contratto vigente tra te e la banca stessa. Il rimborso dovrà essere richiesto entro 8 settimane a partire dalla data di addebito sul tuo conto corrente. I tuoi diritti sono spiegati in un'informativa che puoi richiedere presso la tua banca.  Inoltre, acconsenti a ricevere le notifiche per addebiti futuri fino a 2 giorni prima la loro data.",websiteStoreOrderSummary:"Riepilogo dell'ordine",websiteStoreOrderSummaryItems:{zero:"{quantity} articoli\n{quantity} articolo\n{quantity} articoli"},websiteStoreOrderSummaryOrderNote:"Nota per l'ordine",websiteStoreOrderSummaryTotalPlaceholder:"Per vedere l'importo totale, seleziona il paese di destinazione dell'ordine.",websiteStorePaymentBoxCheckboxLabel:"Ho letto e accetto le [Condizioni generali di contratto]({termsAndConditionsLink}), la [Politica sul reso]({cancellationPolicyLink}) e la [Dichiarazione sulla privacy]({privacyPolicyLink}).",websiteStorePaymentBoxConsent:"Effettuando l'ordine, accetto i [Termini e le condizioni generali]({termsAndConditionsLink}). Dichiaro di aver letto la [Dichiarazione sulla privacy]({privacyPolicyLink}).",websiteStorePaymentBoxProviderHintPayPal:"I pagamenti avverranno attraverso PayPal",websiteStorePaymentBoxTitle:"Metodo di pagamento",websiteStorePaymentOptionsErrorUnavailableProvider:"Alcuni metodi di pagamento potrebbero non essere disponibili al momento a causa di alcuni problemi tecnici. Riprova tra qualche minuto o contatta il tuo provider.",websiteStorePaymentOptionsHeader:"Opzioni di pagamento",websiteStorePaymentProviderSelection:"Paga con {paymentProvider}",websiteStorePaymentProviderSelectionIdeal:"Pagare con {paymentProvider} o iDeal",websiteStoreProductQuantity:"Qtà",websiteStoreShippingAddress:"Indirizzo di spedizione",websiteStoreShippingAddressHeadline:"Indirizzo di spedizione",websiteStoreShipToDifferentAddress:"Spedizione a un indirizzo diverso",websiteStoreStripePaymentInformationError:"Siamo spiacenti, si è verificato un problema durante l'elaborazione del tuo pagamento. Ti preghiamo di riprovare tra qualche minuto o usare un altro metodo di pagamento.",websiteStoreVariantLoadingError:"Siamo spiacenti, al momento non è possibile caricare le informazioni sul prodotto. Riprova più tardi.",websiteStyleNameCandy:"Caramella",websiteStyleNameDark:"Scuro",websiteStyleNameElegant:"Elegante",websiteStyleNameFancy:"Sofisticato",websiteStyleNameMinimal:"Minimalista",websiteStyleNameMint:"Menta",websiteStyleNameModern:"Moderno",websiteStyleNameNatural:"Naturale",websiteStyleNameNordic:"Nordico",websiteStyleNameOcean:"Oceano",websiteStyleNamePastel:"Pastello",websiteStyleNamePlayful:"Spiritoso",websiteStyleNameTropical:"Tropicale",websiteTermsOfUseBodyText:"# Termini e condizioni\n\nLa vendita e la sottoscrizione di contratti online sono diventati indispensabili quando si ha un'attività. La prima regola da seguire quando porti la tua attività online è che i tuoi clienti sappiano cosa aspettarsi e in che modalità. Sebbene in alcuni Paesi non esistano requisiti legali che impongono la presenza di termini e condizioni sui siti web, è importante stabilirli per garantire alla tua attività online una certa tutela legale. Inoltre, riportando termini adeguati, ti assicuri che i tuoi clienti siano debitamente informati sugli acquisti di prodotti o servizi sul tuo sito.\n\n<p><br></p>\n\nOvviamente i termini di utilizzo variano in base al tipo di attività che conduci, alla natura della tua offerta e ai requisiti legali del mercato di riferimento. Quando crei un sito web non lasci nulla al caso e questo dovrebbe valere anche quando scrivi testi importanti per la tua attività online. Come per qualsiasi tipo di contratto, è opportuno consultare un esperto legale prima di pubblicare termini di utilizzo vincolanti sul tuo sito. Per iniziare, ti consigliamo di consultare alcuni dei più noti generatori di testi di termini di utilizzo che potrai trovare con una veloce ricerca online. Assicurati di trovare quello adatto al tuo mercato e ricorda che i generatori di testi di termini di utilizzo non possono in alcun modo sostituire l'esperienza e la competenza di un professionista legale.",wizardAlreadyHaveAnAccount:"Hai già un account? In questo caso, puoi accedere da qui.",wizardAlreadySignedUp:"Hai già un account?",wizardBackButtonLabel:"Indietro",wizardBusinessCategoryStepAdditionalInformation:"Usiamo queste informazioni per suggerirti gli strumenti e i servizi giusti per la tua attività.",wizardBusinessCategoryStepSearchInputPlaceholder:"Cerca una categoria",wizardBusinessCategoryStepSearchSelectEmptySearch:"Ci dispiace, ma non è presente nessuna categoria con quel nome...",wizardBusinessCategoryStepSearchSelectSkip:"Salta",wizardBusinessCategoryStepTitle:"A quale categoria appartiene la tua attività?",wizardBusinessProfileNewAdditionalIn